import React, { Component } from 'react'
import Pokemon from './Pokemon'

class Pokedex extends Component {
  render() {
    return this.props.pokemons.map(pokemon => {
      const { id, name, type, averageWeight, image, moreInfo } = pokemon
    })
  }
}
